import React, { Component } from 'react';
import { Button, Icon } from 'antd';

class Third extends Component {
    onClick = () => {
        console.log("You clicked button");
    }
    render() {
        return (
            <div>
                <Button type = "dashed" onClick = { () => {
                this.setState({
                    number : this.state.number + 1
                })}}>Cilck here</Button>
                <Icon type="up-circle" />
            </div>
        );
    }
}

export default Third;
